export const getRatingScore = (game) => {
  if (!game.rating) {
    return "Нет рейтинга";
  }

  return `${game.rating}/5`;
};

export const getRatingName = (ratings) => {
  if (!ratings || ratings.length == 0) {
    return "Нет рейтинга";
  }

  const maxPercent = ratings.reduce((p, c) => (p.percent > c.percent ? p : c));

  return maxPercent?.title == "exceptional"
    ? "Необычайная"
    : maxPercent?.title == "recommended"
    ? "Рекомендую"
    : maxPercent?.title == "skip"
    ? "Пропущу"
    : maxPercent?.title == "meh"
    ? "Ну такое"
    : maxPercent?.title;
};

export const getRatingsSorted = (ratings) => {
  return ratings.sort((a, b) => b.id - a.id);
};

